import React from 'react';
import { Link, Outlet } from 'react-router-dom'
import logo from '../src/assets/logo.png'
import "./App.css"

function App() {
  return (
    <div>
      <img src={logo} alt="space-x-logo"/>
      <nav>
        <Link to="/dragons">
          Dragons
        </Link>
        <Link to="/rockets">
          Rockets
        </Link>
        <Link to="/ships">
          Ships
        </Link>
      </nav>
      <Outlet/>
    </div>
  );
};

export default App;
